import React from 'react';
import {Routes, Route} from 'react-router-dom';
import Home from './Home';
import Main from './Main';


function App() {
  return (
    <div>
      <Routes>
        <Route exact path='/' element={<Main/>}></Route>
        {/* <Route path='/Adminpag' element={<Home/>}></Route> */}
      </Routes>
    </div>
  );
}

export default App;
